import { BrandLogo } from "../brandLogo";

const NavbarContainer = styled.div`
  width: 100%;
  height: 85px;
  display: flex;
  align-items: center;

`;

export function Navbar(props) {
  return (
    <NavbarContainer>
      <BrandLogo />
    </NavbarContainer>
  );  
};
